        slogan: 'Prueba',
        repo: 'Prueba',
        demo: 'Prueba',
        technologies: 'Prueba',
        desc: 'Prueba',
        autor: 'Prueba',
        job: 'Prueba',
        image: 'Prueba',
        photo: 'Prueba',
    }
    return (
        <>
            <p>Soy la Landing</p>
            <Link to='/create-card'>Crear tarjeta</Link>
            <Card data={obj1}></Card>
        </>
    )
}

export default Landing;
